#[inline]
/// Convert a raw reading into a delta using `delta_from_ref` lookup table data.
pub const fn delta_from_ref(raw: u16) -> i32 {
    let idx = usize::from(raw.clamp(LUT_MIN, LUT_MAX).saturating_sub(LUT_MIN));
    i32::from(LUT_DELTA.get(idx).copied().unwrap_or_default()).saturating_div(LUT_SCALE)
}
